import React from 'react';
const Index = ()=> {
    return(
        <>
         <header>Podcast</header>
        
        <style jsx>{`
            :global(body) {
                padding: 0;
                margin: 0;
                font-family: system-ui;
            }
            header {
                color: #fff;
                background: #8756ca;
                padding: 15px;
                text-align:center;
            }
        `}</style>
        </>
    )

}

export default Index;
